import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import { BrowserRouter as Router, Route, Routes, Link, useParams, useLocation, useNavigate } from "react-router-dom";
import Main from './components/Main/Main';
import SubmitPage from './components/Main/SubmitPage';
function App() {
  useEffect(() => {
    // Make an API call to the Node.js server
    axios.get('http://localhost:5000/api/hello')
      .then(response => {
        setMessage(response.data.message);
      })
      .catch(error => {
        console.error("There was an error fetching the data!", error);
      });
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<SubmitPage></SubmitPage>}></Route>
        <Route path="/list" element={<Main></Main>}></Route>
      </Routes>
    </Router>
  );
}

export default App;
